import React from "react";
import './ProdCard.css';
import Gaadi from '../../assets/Images/gaadi.png';
import Hot from '../../assets/Images/Hot.png';

 

function ProductCard(props){
  return (
    <div className="card">
      <img src={props.imgSrc} alt="Playstation" className="cardImg" />
      <div className="tag">
        <img src={Hot} alt="" />
        <p>HOT</p>
      </div>
      <p className="prodName">{props.name}</p>
      <p className="day">{props.day}</p>
      <img src={Gaadi} alt="" className="gaadi" />
      <p className="start">Starts at</p>
      <p className="price">{props.price}</p>
      <button>
        <div className="buttonContent">
        <span className="buttonText">Rent Now</span>
        </div>
      </button>
    </div>
  );
};

export default ProductCard;
